// Enhanced lead scoring for your specific requirements
const contacts = $input.all();

if (contacts.length === 0) {
  console.log('No contacts to score');
  return [];
}

const scoredContacts = contacts.map(item => {
  const contact = item.json;
  let score = contact.lead_score || 0; // Start with existing score

  // Additional CPG-specific scoring
  const title = (contact.title || '').toLowerCase();
  const company = (contact.company || '').toLowerCase();
  const industry = (contact.company_industry || '').toLowerCase();

  // Industry bonus (20 points)
  if (industry.includes('food') || industry.includes('beverage')) {
    score += 20;
  } else if (industry.includes('consumer') || industry.includes('retail')) {
    score += 15;
  } else if (industry.includes('beauty') || industry.includes('cosmetics')) {
    score += 15;
  }

  // Company name quality (10 points)
  if (company && !company.includes('n/a') && company.length > 2) {
    score += 10;
  }

  // Location bonus (5 points)
  if (contact.country === 'United States' || contact.country === 'Canada') {
    score += 5;
  }

  // Update grade based on new score
  let grade = contact.grade || 'D';
  if (score >= 90) grade = 'A+';
  else if (score >= 80) grade = 'A';
  else if (score >= 70) grade = 'B+';
  else if (score >= 60) grade = 'B';
  else if (score >= 50) grade = 'C+';
  else if (score >= 40) grade = 'C';
  else grade = 'D';

  return {
    ...item,
    json: {
      ...contact,
      lead_score: score,
      grade: grade,
      scored_date: new Date().toISOString()
    }
  };
});

// Sort by score (highest first)
scoredContacts.sort((a, b) => b.json.lead_score - a.json.lead_score);

// Log distribution
const gradeDistribution = {};
scoredContacts.forEach(item => {
  const grade = item.json.grade;
  gradeDistribution[grade] = (gradeDistribution[grade] || 0) + 1;
});

console.log(`Scored ${scoredContacts.length} contacts. Grade distribution:`, gradeDistribution);

return scoredContacts;

// Fixed Apollo Lead Processing - uses CONTACTS array
const inputData = $input.all();
let outputData = [];

try {
  console.log('=== Lead Processing Start ===');
  console.log('Input items:', inputData.length);

  for (let i = 0; i < inputData.length; i++) {
    const item = inputData[i];

    // Get CONTACTS array (not people!)
    let contacts = [];
    if (item.json?.contacts && Array.isArray(item.json.contacts)) {
      contacts = item.json.contacts;
      console.log(`Item ${i}: Found ${contacts.length} contacts`);
    } else {
      console.log(`Item ${i}: No contacts array found`);
      continue;
    }

    // Process each contact
    contacts.forEach((contact) => {
      try {
        // Basic info
        const firstName = contact.first_name || 'N/A';
        const lastName = contact.last_name || 'N/A';
        const fullName = contact.name || `${firstName} ${lastName}`.trim() || 'N/A';
        const title = contact.title || 'N/A';
        const email = contact.email || 'N/A';

        // Company
        const companyName = contact.organization?.name || 
                           contact.organization_name || 
                           contact.account?.name || 'N/A';
        const companyWebsite = contact.organization?.website_url || 
                              contact.account?.website_url || 'N/A';
        const companyIndustry = contact.organization?.industry || 
                               contact.account?.industry || 'N/A';
        const foundedYear = contact.organization?.founded_year || 
                           contact.account?.founded_year || 'N/A';

        // Phone
        let phone = 'N/A';
        if (contact.phone_numbers?.[0]) {
          phone = contact.phone_numbers[0].raw_number || 
                  contact.phone_numbers[0].sanitized_number || 
                  contact.phone_numbers[0].number || 'N/A';
        } else if (contact.sanitized_phone) {
          phone = contact.sanitized_phone;
        }

        // Location
        const city = contact.city || 'N/A';
        const state = contact.state || 'N/A';
        const country = contact.country || 'N/A';

        // LinkedIn - check multiple fields
        const linkedinUrl = contact.linkedin_url || 
                           contact.linkedin || 
                           contact.profile_url || 
                           'N/A';

        if (linkedinUrl !== 'N/A') {
          console.log(`✓ LinkedIn: ${fullName} -> ${linkedinUrl}`);
        } else {
          console.log(`✗ No LinkedIn for ${fullName}`);
        }

        // Email status
        const emailStatus = contact.email_status || 'N/A';
        const emailVerified = emailStatus === 'verified' ? 'Yes' : 'No';

        // Score
        let leadScore = 0;
        if (emailVerified === 'Yes') leadScore += 25;
        if (title.toLowerCase().includes('ceo') || title.toLowerCase().includes('founder')) leadScore += 30;
        if (title.toLowerCase().includes('co-founder') || title.toLowerCase().includes('co-ceo')) leadScore += 25;
        if (phone !== 'N/A') leadScore += 20;
        if (linkedinUrl !== 'N/A') leadScore += 15;

        // Grade
        let grade = 'D';
        if (leadScore >= 80) grade = 'A+';
        else if (leadScore >= 70) grade = 'A';
        else if (leadScore >= 60) grade = 'B+';
        else if (leadScore >= 50) grade = 'B';
        else if (leadScore >= 40) grade = 'C+';
        else if (leadScore >= 30) grade = 'C';

        // Output
        outputData.push({
          json: {
            first_name: firstName,
            last_name: lastName,
            full_name: fullName,
            title: title,
            email: email,
            phone: phone,
            company: companyName,
            company_website: companyWebsite,
            company_industry: companyIndustry,
            founded_year: foundedYear,
            city: city,
            state: state,
            country: country,
            linkedin_url: linkedinUrl,
            email_status: emailStatus,
            email_verified: emailVerified,
            lead_score: leadScore,
            grade: grade,
            apollo_id: contact.id || 'N/A',
            created_at: new Date().toISOString()
          },
          pairedItem: { item: i }
        });

      } catch (contactError) {
        console.log('Error processing contact:', contactError.message);
      }
    });
  }

  console.log(`=== Complete: ${outputData.length} contacts processed ===`);

} catch (error) {
  console.log('=== Error ===');
  console.log('Error:', error.message);
}

if (outputData.length === 0) {
  return [{
    json: {
      error: 'No contacts processed',
      debug: 'Check console logs'
    }
  }];
}

return outputData;

// Based on your exact current parameters with daily rotation
const today = new Date();
const dayOfWeek = today.getDay();

// Your industries split into daily rotations
const industryRotations = [
  // Sunday: Food & Beverage Focus
  ["food & beverages", "food production"],
  // Monday: Consumer Goods & Cosmetics
  ["consumer goods", "cosmetics", "beauty", "personal care"],
  // Tuesday: Fashion & Electronics  
  ["apparel & fashion", "consumer electronics"],
  // Wednesday: Health & Wellness
  ["health & wellness", "beauty", "personal care"],
  // Thursday: Retail Focus
  ["retail", "consumer goods"],
  // Friday: All CPG (broader search)
  ["consumer goods", "food & beverages", "cosmetics", "retail"],
  // Saturday: Premium/Beauty Focus
  ["cosmetics", "beauty", "personal care", "health & wellness"]
];

// Company size rotation (weekly)
const sizeRotations = [
  ["1,10"],           // Week 1: Micro companies
  ["11,50"],          // Week 2: Small companies  
  ["51,100"],         // Week 3: Medium companies
  ["1,10", "11,50"],  // Week 4: Mixed small
  ["11,50", "51,100"],// Week 5: Mixed medium
  ["1,100"]           // Week 6: All sizes
];

// Title focus rotation
const titleRotations = [
  // Sunday: Pure Founders
  ["Founder", "Co-Founder"],
  // Monday: CEOs
  ["CEO", "Co-CEO", "Chief Executive Officer"],
  // Tuesday: Mixed Leadership
  ["Founder", "CEO"],
  // Wednesday: Co-Leadership Focus
  ["Co-Founder", "Co-CEO"],
  // Thursday: Broad Leadership
  ["Founder", "Co-Founder", "CEO", "Co-CEO"],
  // Friday: Founder + CEO
  ["Founder", "CEO", "Chief Executive Officer"],
  // Saturday: All (your original)
  ["Founder", "Co-Founder", "CEO", "Co-CEO"]
];

// Revenue range rotation (monthly)
const revenueRotations = [
  { min: 100000, max: 1000000 },      // $100K-$1M
  { min: 500000, max: 5000000 },      // $500K-$5M  
  { min: 1000000, max: 10000000 },    // $1M-$10M
  { min: 2000000, max: 20000000 },    // $2M-$20M
  { min: 5000000, max: 50000000 },    // $5M-$50M
  { min: 100000, max: 10000000 },     // Mixed range
  { min: 1000000, max: 25000000 }     // Mid-high range
];

// Location rotation
const locationRotations = [
  ["United States"],
  ["Canada"], 
  ["United States", "Canada"]
];

// Calculate current rotations
const weekOfYear = Math.floor((today - new Date(today.getFullYear(), 0, 1)) / 604800000);
const monthOfYear = today.getMonth();

const currentIndustries = industryRotations[dayOfWeek];
const currentSizes = sizeRotations[weekOfYear % sizeRotations.length];
const currentTitles = titleRotations[dayOfWeek];
const currentRevenue = revenueRotations[monthOfYear % revenueRotations.length];
const currentLocations = locationRotations[Math.floor(weekOfYear / 2) % locationRotations.length];

// Page advancement for avoiding duplicates
const storedState = globalThis.apolloState || { lastPage: 0, lastDate: null };
const todayStr = today.toDateString();

let currentPage = 1;
if (storedState.lastDate === todayStr) {
  currentPage = Math.min(storedState.lastPage + 1, 10);
} else {
  currentPage = 1;
}

globalThis.apolloState = { lastPage: currentPage, lastDate: todayStr };

// Build search parameters
const searchParams = {
  page: currentPage,
  per_page: 25,
  person_titles: currentTitles,
  seniorities: ["founder", "c", "owner"],
  person_locations: currentLocations,
  industries: currentIndustries,
  organization_num_employees_ranges: currentSizes,
  organization_latest_funding_stage: ["pre_seed", "seed", "series_a", "series_b"],
  organization_founded_year_min: 2015,
  reveal_personal_emails: true,
  email_status: ["verified", "likely", "accept_all"],
  organization_estimated_annual_revenue_min: currentRevenue.min,
  organization_estimated_annual_revenue_max: currentRevenue.max
};

console.log(`Day ${dayOfWeek}, Page ${currentPage}: ${currentIndustries.join(', ')}`);

return [{
  json: {
    body: searchParams,
    metadata: { day: dayOfWeek, page: currentPage, date: todayStr }
  }
}];

// Simplified Remove Duplicates - Phase 1 (without external sheet checking)
const processedLeads = $input.all();

console.log(`Remove Duplicates - Received ${processedLeads.length} processed leads`);

if (processedLeads.length === 0) {
  console.log('No processed leads to check for duplicates');
  return [];
}

// For now, just pass through all contacts (no duplicate checking yet)
// We'll add external duplicate checking after we get the workflow working
const uniqueContacts = [];
const seenEmails = new Set();
const seenNames = new Set();

// Remove duplicates within THIS batch only
processedLeads.forEach(item => {
  const contact = item.json;

  const email = contact.email?.toLowerCase();
  const nameCompany = `${contact.full_name}_${contact.company}`.toLowerCase().replace(/\s+/g, '');

  // Skip if we've seen this contact in current batch
  if (email && email !== 'n/a' && seenEmails.has(email)) {
    console.log(`Batch duplicate (email): ${contact.full_name} - ${email}`);
    return;
  }

  if (seenNames.has(nameCompany)) {
    console.log(`Batch duplicate (name+company): ${contact.full_name} - ${contact.company}`);
    return;
  }

  // Add to seen sets
  if (email && email !== 'n/a') seenEmails.add(email);
  seenNames.add(nameCompany);

  // Add to unique contacts
  uniqueContacts.push({
    ...item,
    json: {
      ...contact,
      batch_duplicates_removed: processedLeads.length - uniqueContacts.length - 1
    }
  });
});

const batchDuplicatesRemoved = processedLeads.length - uniqueContacts.length;
console.log(`Batch duplicates removed: ${batchDuplicatesRemoved}, Unique contacts: ${uniqueContacts.length}`);

return uniqueContacts;

// Final formatting with LinkedIn
const contacts = $input.all();

const formatted = contacts.map(item => {
  const c = item.json;

  return {
    json: {
      'First Name': c.first_name || '',
      'Last Name': c.last_name || '',
      'Full Name': c.full_name || '',
      'Email': c.email || '',
      'Phone': c.phone || '',
      'Title': c.title || '',
      'Company': c.company || '',
      'City': c.city || '',
      'State': c.state || '',
      'Country': c.country || '',
      'LinkedIn': c.linkedin_url || '', // Make sure this is included
      'Lead Score': c.lead_score || 0,
      'Grade': c.grade || '',
      'Apollo ID': c.apollo_id || '',
      'Found Date': new Date().toISOString()
    }
  };
});

return formatted;
